import React from "react";
import "./HowToDoDetails.css";
import image from "../User-images/NewsImage1.webp";

function HowToDoDetails() {
  return (
    <div>
      <h1 style={{ textAlign: "center", fontFamily: "sans-serif" }}>
        <b>
          <big>How-To</big>
        </b>
      </h1>
      <br />
      <div className="how-to-container">
        <div className="how-to-heading">
          <h1>How to Download YouTube Videos</h1>
        </div>
        <br />
        <br />
        <div className="imageContainer">
          <img className="NewsImage" src={image} alt="Laptop image" />
        </div>
      </div>
    </div>
  );
}

export default HowToDoDetails;
